import React, { useState, useEffect } from 'react';

function ExploreProjects() {
  const [projects, setProjects] = useState([]);

  useEffect(() => {
    // Fetch projects from smart contract or backend
    const fetchProjects = async () => {
      const fetchedProjects = [
        { id: 1, title: 'Project A', description: 'A description of project A' },
        { id: 2, title: 'Project B', description: 'A description of project B' },
      ];
      setProjects(fetchedProjects);
    };
    fetchProjects();
  }, []);

  const containerStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f9f9f9',
    padding: '2rem',
    gap: '1rem',
    textAlign: 'center',
  };

  const listStyle = {
    listStyleType: 'none',
    padding: 0,
    width: '80%',
    maxWidth: '600px',
    display: 'flex',
    flexDirection: 'column',
    gap: '1.5rem',
  };

  const listItemStyle = {
    backgroundColor: '#fff',
    padding: '1rem',
    borderRadius: '8px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    textAlign: 'left',
  };

  return (
    <div style={containerStyle}>
      <h2>Explore Projects</h2>
      {projects.length === 0 ? (
        <p>No projects available currently. Please check back later.</p>
      ) : (
        <ul style={listStyle}>
          {projects.map((project) => (
            <li key={project.id} style={listItemStyle}>
              <h3>{project.title}</h3>
              <p>{project.description}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default ExploreProjects;
